import React from "react"
import {  } from "react-router-dom";


// class EventShow extends Component 

const EventList = (props) => {
    // render(){
    return(
        <>
     <h1>EVENT SHOW HERE</h1>
    <table>
        <tbody>
        {this.state.events.map(events =>{
            return (
              <tr key={events._id}>
                <td> {events.name }</td>
              </tr>
            )
          })}
        </tbody>
    </table>
    </>
)}


export default EventList;
